import React, { useState, useEffect } from 'react';

const OpenAIManager = () => {
  const [openaiKeys, setOpenaiKeys] = useState([]);
  const [selectedKey, setSelectedKey] = useState('');
  const [newKeyName, setNewKeyName] = useState('');
  const [newKeyValue, setNewKeyValue] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  // OpenAI ÌÇ§ Î™©Î°ù Í∞ÄÏ†∏Ïò§Í∏∞
  const fetchOpenAIKeys = async () => {
    setLoading(true);
    try {
      const response = await fetch('/api/openai/keys', { credentials: 'include' });
      if (response.ok) {
        const data = await response.json();
        setOpenaiKeys(data.keys || []);
        setSelectedKey(data.selected || '');
      } else {
        console.error('OpenAI ÌÇ§ Î™©Î°ù Í∞ÄÏ†∏Ïò§Í∏∞ Ïã§Ìå®');
      }
    } catch (error) {
      console.error('OpenAI ÌÇ§ Î™©Î°ù ÏöîÏ≤≠ Ïò§Î•ò:', error);
    } finally {
      setLoading(false);
    }
  };

  // ÌÇ§ Ï∂îÍ∞Ä
  const handleAddKey = async (e) => {
    e.preventDefault();
    if (!newKeyName.trim() || !newKeyValue.trim()) {
      setError('ÌÇ§ Ïù¥Î¶ÑÍ≥º Í∞íÏùÄ ÌïÑÏàòÏûÖÎãàÎã§.');
      return;
    }

    setLoading(true);
    try {
      const formData = new FormData();
      formData.append('name', newKeyName);
      formData.append('key', newKeyValue);

      const response = await fetch('/api/openai/keys', {
        method: 'POST',
        body: formData,
        credentials: 'include'
      });

      if (response.ok) {
        const data = await response.json();
        setOpenaiKeys(data.keys);

        setNewKeyName('');
        setNewKeyValue('');
        setSuccess('OpenAI API ÌÇ§Í∞Ä ÏÑ±Í≥µÏ†ÅÏúºÎ°ú Ï∂îÍ∞ÄÎêòÏóàÏäµÎãàÎã§.');
        setError('');
      } else {
        setError('ÌÇ§ Ï∂îÍ∞ÄÏóê Ïã§Ìå®ÌñàÏäµÎãàÎã§.');
      }
    } catch (error) {
      setError('ÌÇ§ Ï∂îÍ∞Ä Ï§ë Ïò§Î•òÍ∞Ä Î∞úÏÉùÌñàÏäµÎãàÎã§.');
    } finally {
      setLoading(false);
    }
  };

  // ÌÇ§ ÏÑ†ÌÉù
  const handleSelectKey = async (keyName) => {
    setLoading(true);
    try {
      const formData = new FormData();
      formData.append('name', keyName);

      const response = await fetch('/api/openai/select', {
        method: 'POST',
        body: formData,
        credentials: 'include'
      });

      if (response.ok) {
        setSelectedKey(keyName);
        setSuccess('OpenAI API ÌÇ§Í∞Ä ÏÑ†ÌÉùÎêòÏóàÏäµÎãàÎã§.');
        setError('');
      } else {
        setError('ÌÇ§ ÏÑ†ÌÉùÏóê Ïã§Ìå®ÌñàÏäµÎãàÎã§.');
      }
    } catch (error) {
      setError('ÌÇ§ ÏÑ†ÌÉù Ï§ë Ïò§Î•òÍ∞Ä Î∞úÏÉùÌñàÏäµÎãàÎã§.');
    } finally {
      setLoading(false);
    }
  };

  // ÌÇ§ ÏÇ≠Ï†ú
  const handleDeleteKey = async (keyName) => {
    if (!window.confirm(`Ï†ïÎßêÎ°ú "${keyName}" ÌÇ§Î•º ÏÇ≠Ï†úÌïòÏãúÍ≤†ÏäµÎãàÍπå?`)) {
      return;
    }

    setLoading(true);
    try {
      const response = await fetch(`/api/openai/keys/${keyName}`, {
        method: 'DELETE',
        credentials: 'include'
      });

      if (response.ok) {
        const data = await response.json();
        setOpenaiKeys(data.keys);

        if (selectedKey === keyName) {
          setSelectedKey('');
        }

        setSuccess('OpenAI API ÌÇ§Í∞Ä ÏÇ≠Ï†úÎêòÏóàÏäµÎãàÎã§.');
        setError('');
      } else {
        setError('ÌÇ§ ÏÇ≠Ï†úÏóê Ïã§Ìå®ÌñàÏäµÎãàÎã§.');
      }
    } catch (error) {
      setError('ÌÇ§ ÏÇ≠Ï†ú Ï§ë Ïò§Î•òÍ∞Ä Î∞úÏÉùÌñàÏäµÎãàÎã§.');
    } finally {
      setLoading(false);
    }
  };

  // ÌÇ§ ÎßàÏä§ÌÇπ Ìï®Ïàò (Ïïû 3Í∏ÄÏûê + ... + Îí§ 4Í∏ÄÏûêÎßå Î≥¥Ïù¥Í≤å)
  const maskKey = (key) => {
    if (!key) return '';
    if (key.length <= 8) return '*'.repeat(key.length);
    return key.substring(0, 3) + '***...***' + key.substring(key.length - 4);
  };

  useEffect(() => {
    fetchOpenAIKeys();
  }, []);

  return (
    <div className="openai-manager">
      <div className="section-header">
        <h2>üîë OpenAI API ÌÇ§ Í¥ÄÎ¶¨</h2>
        <p>ÏûêÏó∞Ïñ¥‚ÜíSQL Î≥ÄÌôòÏùÑ ÏúÑÌïú OpenAI API ÌÇ§Î•º Îì±Î°ùÌïòÍ≥† Í¥ÄÎ¶¨ÌïòÏÑ∏Ïöî.</p>
      </div>

      {/* ÏÉÅÌÉú Î©îÏãúÏßÄ */}
      {error && (
        <div className="alert alert-error">
          <span>‚ö†Ô∏è {error}</span>
          <button onClick={() => setError('')} className="close-btn">‚úï</button>
        </div>
      )}

      {success && (
        <div className="alert alert-success">
          <span>‚úÖ {success}</span>
          <button onClick={() => setSuccess('')} className="close-btn">‚úï</button>
        </div>
      )}

      {/* ÌÇ§ Ï∂îÍ∞Ä Ìèº */}
      <div className="card">
        <h3>ÏÉà API ÌÇ§ Ï∂îÍ∞Ä</h3>
        <form onSubmit={handleAddKey} className="form">
          <div className="form-group">
            <label htmlFor="key-name">ÌÇ§ Ïù¥Î¶Ñ:</label>
            <input
              type="text"
              id="key-name"
              value={newKeyName}
              onChange={(e) => setNewKeyName(e.target.value)}
              placeholder="Ïòà: Production Key, Development Key"
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="key-value">API ÌÇ§:</label>
            <input
              type="password"
              id="key-value"
              value={newKeyValue}
              onChange={(e) => setNewKeyValue(e.target.value)}
              placeholder="sk-..."
              required
            />
          </div>

          <button 
            type="submit" 
            className="btn btn-primary"
            disabled={loading}
          >
            {loading ? 'Ï∂îÍ∞Ä Ï§ë...' : 'ÌÇ§ Ï∂îÍ∞Ä'}
          </button>
        </form>
      </div>

      {/* Îì±Î°ùÎêú ÌÇ§ Î™©Î°ù */}
      <div className="card">
        <h3>Îì±Î°ùÎêú API ÌÇ§</h3>
        {openaiKeys.length === 0 ? (
          <div className="empty-state">
            <p>Îì±Î°ùÎêú OpenAI API ÌÇ§Í∞Ä ÏóÜÏäµÎãàÎã§.</p>
            <p>ÏúÑÏóêÏÑú ÏÉà ÌÇ§Î•º Ï∂îÍ∞ÄÌï¥Ï£ºÏÑ∏Ïöî.</p>
          </div>
        ) : (
          <div className="key-list">
            {openaiKeys.map((key, index) => (
              <div 
                key={index} 
                className={`key-item ${selectedKey === key.name ? 'selected' : ''}`}
              >
                <div className="key-info">
                  <div className="key-name">
                    <strong>{key.name}</strong>
                    {selectedKey === key.name && (
                      <span className="selected-badge">ÏÑ†ÌÉùÎê®</span>
                    )}
                  </div>
                  <div className="key-value">
                    {maskKey(key.key)}
                  </div>
                </div>
                <div className="key-actions">
                  {selectedKey !== key.name && (
                    <button
                      onClick={() => handleSelectKey(key.name)}
                      className="btn btn-sm btn-outline"
                      disabled={loading}
                    >
                      ÏÑ†ÌÉù
                    </button>
                  )}
                  <button
                    onClick={() => handleDeleteKey(key.name)}
                    className="btn btn-sm btn-danger"
                    disabled={loading}
                  >
                    ÏÇ≠Ï†ú
                  </button>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>

      {/* ÏÇ¨Ïö©Î≤ï ÏïàÎÇ¥ */}
      <div className="card">
        <h3>üìñ ÏÇ¨Ïö©Î≤ï</h3>
        <div className="usage-guide">
          <ol>
            <li>OpenAIÏóêÏÑú API ÌÇ§Î•º Î∞úÍ∏âÎ∞õÏúºÏÑ∏Ïöî (<a href="https://platform.openai.com/api-keys" target="_blank" rel="noopener noreferrer">https://platform.openai.com/api-keys</a>)</li>
            <li>ÏúÑ ÌèºÏóêÏÑú ÌÇ§ Ïù¥Î¶ÑÍ≥º API ÌÇ§Î•º ÏûÖÎ†•ÌïòÍ≥† Ï∂îÍ∞ÄÌïòÏÑ∏Ïöî</li>
            <li>ÏÇ¨Ïö©Ìï† ÌÇ§Î•º ÏÑ†ÌÉùÌïòÏÑ∏Ïöî</li>
            <li>AI Ï±ÑÌåÖÏóêÏÑú ÏûêÏó∞Ïñ¥Î°ú Îç∞Ïù¥ÌÑ∞Î≤†Ïù¥Ïä§Î•º ÏßàÏùòÌï† Ïàò ÏûàÏäµÎãàÎã§</li>
          </ol>
        </div>
      </div>
    </div>
  );
};

export default OpenAIManager;
